INSERT INTO `website_sections` (`section_name`, `section_content`, `section_title`, `section_head`) VALUES
('profiles', '<p>Profiles gives you the opportunity to associate names and faces to skillsets and ensure that their expertise, experience and education meets your requirements.  You can also download their CV''s from the ''Related Links'' panel.</p>', 'Our profiles', 'Who we are'),
('showcase', '<p>Browse through our showcase to see who we''ve worked for and what work we have done.</p>', 'Our showcase', 'Work we''ve done'),
('home', 'Absolute Orange Ltd is a co-operative of freelancer web developers operating under one company:Team of skills:Individual web developers offer their own unique skillset whilst having access to a team of web developers with which they can share knowledge and skills:Accountable:Absolute Orange aims to take the risk out of freelancing by taking full accountability of contract deliverables.  Ensuring that the implemented solution is the best possible fit when considering the specification and resources and that the solution provided is of sound logic and presented in clear, well written code with documentation (where applicable):Professional:Well presented developers who work in a disciplined and enthusiastic manner at a team level and who are passionate about their work:Provision of software and hardware:Absolute Orange will provide hardware and software to meet solution requirements wherever possible:', 'Welcome', 'Can we help you?'),
('about us', '<p>Absolute Orange recognises that the outsourcing of web development tasks may be the best option for you.&nbsp;&nbsp;Formed in January 2009 Absolute Orange provides skilled, professional experts on an adhoc basis to fufill your identified requirements in a timely manner at competitive prices.</p>\r\n', 'About us', 'What is Absolute Orange?'),
('blogs', '<p>Nothing is more useful than the information you''ve been looking for.&nbsp;&nbsp;Our blogs communicate our recent findings and expertise within our skillset.</p>\r\n<p>Please select a blog from the menu.</p>', 'Our blogs', 'Sharing our knowledge'),
('contact us ', '<p>Phone us, Skype us or use our online contact form to get in touch.</p>', 'Contact us', 'Get in touch'),
(NULL, NULL, '', '');
